import { useEffect, useState, useContext } from "react";
import API from "../api/axios";
import { AuthContext } from "../context/AuthContext";

interface Milestone {
    id: number;
    projectId: number;
    title: string;
    dueDate: string;
    isCompleted: boolean;
}

const MilestonesPage = () => {
    const { token } = useContext(AuthContext);
    const [milestones, setMilestones] = useState<Milestone[]>([]);
    const [newMilestone, setNewMilestone] = useState({ projectId: "", title: "", dueDate: "" });

    const fetchMilestones = async () => {
        try {
            const res = await API.get("/milestones", {
                headers: { Authorization: `Bearer ${token}` },
            });
            setMilestones(res.data);
        } catch (err) {
            console.error(err);
            alert("Failed to load milestones");
        }
    };

    useEffect(() => {
        fetchMilestones();
    }, []);

    const handleAdd = async (e: React.FormEvent) => {
        e.preventDefault();
        try {
            await API.post("/milestones", newMilestone, {
                headers: { Authorization: `Bearer ${token}` },
            });
            setNewMilestone({ projectId: "", title: "", dueDate: "" });
            fetchMilestones();
        } catch (err) {
            console.error(err);
            alert("Failed to add milestone");
        }
    };

    const handleDelete = async (id: number) => {
        if (!window.confirm("Delete this milestone?")) return;
        try {
            await API.delete(`/milestones/${id}`, {
                headers: { Authorization: `Bearer ${token}` },
            });
            fetchMilestones();
        } catch (err) {
            console.error(err);
            alert("Failed to delete milestone");
        }
    };

    return (
        <div className="container mt-5">
            <h2>Milestones</h2>

            {/* Add Milestone Form */}
            <form onSubmit={handleAdd} className="mb-4 row g-2">
                <div className="col-md-3">
                    <input
                        type="text"
                        placeholder="Project ID"
                        className="form-control"
                        value={newMilestone.projectId}
                        onChange={(e) => setNewMilestone({ ...newMilestone, projectId: e.target.value })}
                        required
                    />
                </div>
                <div className="col-md-4">
                    <input
                        type="text"
                        placeholder="Title"
                        className="form-control"
                        value={newMilestone.title}
                        onChange={(e) => setNewMilestone({ ...newMilestone, title: e.target.value })}
                        required
                    />
                </div>
                <div className="col-md-3">
                    <input
                        type="date"
                        className="form-control"
                        value={newMilestone.dueDate}
                        onChange={(e) => setNewMilestone({ ...newMilestone, dueDate: e.target.value })}
                        required
                    />
                </div>
                <div className="col-md-2">
                    <button type="submit" className="btn btn-primary w-100">
                        Add
                    </button>
                </div>
            </form>

            {/* Milestone List */}
            <table className="table table-striped">
                <thead>
                <tr>
                    <th>Project ID</th>
                    <th>Title</th>
                    <th>Due Date</th>
                    <th>Completed</th>
                    <th>Actions</th>
                </tr>
                </thead>
                <tbody>
                {milestones.map((m) => (
                    <tr key={m.id}>
                        <td>{m.projectId}</td>
                        <td>{m.title}</td>
                        <td>{m.dueDate}</td>
                        <td>{m.isCompleted ? "✅" : "❌"}</td>
                        <td>
                            <button
                                className="btn btn-sm btn-danger"
                                onClick={() => handleDelete(m.id)}
                            >
                                Delete
                            </button>
                        </td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
};

export default MilestonesPage;
